import { createSlice } from '@reduxjs/toolkit';

const initialState = {
    stock: {},
}

const stockSlice = createSlice({
    name: 'stockitem',
    initialState,

});

export default stockSlice.reducer;
export const { loadstock } = stockSlice.actions;
